import Layout from '../components/layout/layout';

const Homepage = () => {
  return (
    <Layout>
      <h1>Get some weather</h1>
      <p>Search for your location in the search bar</p>
      <p>Or click common cities above.</p>
    </Layout>
  )
}
export default Homepage;
